import { BrowserRouter, Switch, Route } from "react-router-dom";
import "./App.css";
import Home from "./Components/Home/Home";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Home} />
        <div className="App bg-dark  d-flex justify-content-center aling-items-center pt-4">
          <Home />
        </div>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
